import React from 'react';
import LoginForm from './LoginRegister/LoginForm';
import './App.css';

function App() {
  return (
    <div className="app">
      <h2>Welcome back</h2>
      <div className="left">
        <LoginForm />
      </div>
      <div className="right">
        <div className="logo">
          <img src="your-logo-image-link" alt="Logo" />
        </div>
        <div className="text">
          Your text here
        </div>
      </div>
    </div>
  );
}

export default App;
